 actually added it back in https://github.com/HwanGoh/uq-vae/commit/e34a89a22287abdd174e2ec576a777dbef801aef.',2,NULL,2,NULL,3,NULL,1,1,3),(13,'0213efdf4d1404b662ae78ddc5aa3d2cb26ad94f',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,4),(14,'035daeb70d07b8ed5da66838579aa7ac1a55d7c4',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5),(15,'040a96f5aa97196a91f081dd482b50b3d1d4f791',0,'New code.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,6),(16,'0434f45502ae57f712ff5afaa33819016addb6cb',0,'In documentation.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,9),(17,'053a89835b3aa78a445351d675a85d52c2f3a63d',1,'Found a referenced PR at https://github.com/dpressel/mead-baseline/pull/617.',4,'Added tf.function to speed up eager mode.',2,NULL,2,NULL,2,NULL,1,0,10),(18,'053b4b28b6f25f69d6f4d7819106392999f52dc3',0,'Referenced issue: https://github.com/tensorflow/probability/issues/542. Also, fails the build. Just looks like new code.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,11),(19,'040a96f5aa97196a91f081dd482b50b3d1d4f791',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,0,6),(20,'0434f45502ae57f712ff5afaa33819016addb6cb',0,'Modified comment.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,0,9),(21,'054095d922edda5134e520522bc82a1b95cc5bd4',1,NULL,1,'There is a removal of tf.function decorator in two files. The comments continue to mention the use of tf.function.',NULL,NULL,NULL,NULL,NULL,NULL,2,1,12),(22,'053a89835b3aa78a445351d675a85d52c2f3a63d',1,'Author added tf.function to speed up eager mode',4,NULL,2,NULL,2,NULL,2,NULL,3,0,10),(25,'053b4b28b6f25f69d6f4d7819106392999f52dc3',0,'New function added.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,0,11),(26,'054095d922edda5134e520522bc82a1b95cc5bd4',1,'Author: Multiple fixes to problems with tf.function execution. ',1,NULL,NULL,NULL,NULL,NULL,1,'Removal of tf.function decorator and addition of new code.',3,1,12),(27,'054095d922edda5134e520522bc82a1b95cc5bd4',1,'Found PR at https://github.com/onnx/onnx-tensorflow/pull/603: \"This PR changes the way the converter executes the computational graph. It moves to using tf.function / tf.module and AutoGraph.\"\r\n\r\nAnother point of interest: \"The function process_pos_pads works in python but not with tf.function, complaining variable constant_values is undefined.\"\r\n\r\nAlso found this commit referenced in the PR: https://github.com/onnx/onnx-tensorflow/pull/603/commits/730c4a2d885971d21e6268cee897cef533a6084a. Actually, this looks like it may be a merge commit.',6,'The function process_pos_pads works in python but not with tf.function, complaining variable constant_values is undefined.',3,NULL,3,NULL,4,NULL,1,1,12),(28,'002b217f983e55811faabf2e548e7c4e66ff09c6',1,NULL,1,NULL,3,NULL,NULL,NULL,NULL,NULL,3,0,13),(29,'028f5747579f6c811ffa399ef88ff6ae03e83642',0,NULL,1,NULL,NULL,NULL,1,NULL,NULL,NULL,3,0,27),(32,'12243a6a2a325f823704be7c72c83e222dd3b53b',0,'tf.function() in a comment.',1,NULL,NULL,NULL,1,NULL,NULL,NULL,3,0,29),(35,'1928424e23f415bddaa92cc08f2620c159a979e3',1,'TpuReplicator does not support pure eager mode.',5,NULL,3,NULL,1,NULL,4,NULL,3,0,18),(36,'05186132c0095b905c090705220ccb8d290629ea',1,NULL,1,NULL,NULL,NULL,NULL,NULL,2,NULL,3,0,16),(37,'0664cd46e2dc3fce0970dd2fe282f78182b623b5',1,NULL,1,NULL,NULL,NULL,NULL,NULL,2,NULL,3,0,17),(38,'0fe70a734dd6ac692f28cb6b1fe1a4ac52965ac3',0,'tf.function in comment.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,0,28),(39,'002b217f983e55811faabf2e548e7c4e66ff09c6',1,'In the commit message, the author states that the use of tf.function is giving autograph warnings even though autograph is false. (This does not regard the tf.function addition for commit)',4,NULL,2,NULL,2,NULL,2,NULL,2,0,13),(41,'d02862f0f81a553468bedb955422c68ef4c0018f',1,'In PR #1396, it states there is an error on graph mode in the constraints and unconstraints representations. (https://github.com/GPflow/GPflow/pull/1247)',7,NULL,4,NULL,4,NULL,5,NULL,2,1,NULL),(42,'028f5747579f6c811ffa399ef88ff6ae03e83642',0,'No repository currently on Github',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,27),(43,'05186132c0095b905c090705220ccb8d290629ea',1,NULL,4,NULL,2,NULL,2,NULL,2,NULL,2,0,14),(44,'0664cd46e2dc3fce0970dd2fe282f78182b623b5',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,17),(45,'0fe70a734dd6ac692f28cb6b1fe1a4ac52965ac3',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,28),(46,'12243a6a2a325f823704be7c72c83e222dd3b53b',0,'No bug fix, but they use tf.function for optimization reasons. As said in the comment. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,29),(47,'1928424e23f415bddaa92cc08f2620c159a979e3',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,NULL),(48,'1928424e23f415bddaa92cc08f2620c159a979e3',1,NULL,8,NULL,2,NULL,5,NULL,2,NULL,2,0,18),(49,'1928424e23f415bddaa92cc08f2620c159a979e3',0,'New code. Guarding against a condition.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,18),(50,'002b217f983e55811faabf2e548e7c4e66ff09c6',0,'When autograph is False, the function is traced and control flow is not allowed to depend on data. https://bit.ly/3jyoZcl\r\n\r\nautograph warnings despite setting autograph=False?\r\n\r\nI don\'t see a fix for this.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,13),(51,'12243a6a2a325f823704be7c72c83e222dd3b53b',0,'Documentation change.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,29),(53,'b65848a22e258dcff566bd5516a431eefae860ee',1,'This commit\'s changeset does not directly involve tf.function. However, it indirectly involves it (see https://bit.ly/3josTUJ).\r\n\r\nHere is the URL: https://github.com/GPflow/GPflow/pull/1418/commits/b65848a22e258dcff566bd5516a431eefae860ee\r\n\r\nThe problem is that ndiagquad() is not compilable when transformed into a tf.function. There is a description and backtrace available at https://github.com/GPflow/GPflow/pull/1418#issue-400827929.\r\n\r\nThe interesting thing about this commit is that, although the fix is pretty straight-forward, by using tf.function, they are making Python into a compiled language. My guess is that this code would have been fine (due to lexical scoping) to run dynamically but because it is now compiled by Autograph, we have a problem.',9,'The inline-defined function unify in gpflow.quadrature.py:ndiagquad was uncompilable - as shown by the stack trace below. I imagine the problem originates from the fact that inline functions are compiled in isolation and don\'t have access to variables defined outside their scope.',5,NULL,6,NULL,6,NULL,1,1,NULL),(54,'05186132c0095b905c090705220ccb8d290629ea',1,NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,16),(62,'028f5747579f6c811ffa399ef88ff6ae03e83642',0,'Looks like a migration to TF 2.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,27),(66,'0664cd46e2dc3fce0970dd2fe282f78182b623b5',1,NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,17),(68,'0fe70a734dd6ac692f28cb6b1fe1a4ac52965ac3',0,'Documentation.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,28),(634,'00a33f7e060caa6616c15003bdac95b7926b76ae',1,'',354,'',334,'',324,'',354,'',1,1,NULL),(644,'00a33f7e060caa6616c15003bdac95b7926b76ae',1,'',354,'',334,'',334,'',354,'',1,1,NULL),(684,'1d16fc105951f7b99930a0caa870de4f99eda176',1,'sd',384,'',364,'',344,'',374,'',2,0,NULL),(694,'1d16fc105951f7b99930a0caa870de4f99eda176',1,'sd',364,'',344,'',3,'',364,'',2,0,NULL),(704,'00d519bb222601f8a264c4abe311757e5079e03f',0,'',NULL,'',NULL,'',NULL,'',NULL,'',1,NULL,NULL),(714,'00d519bb222601f8a264c4abe311757e5079e03f',1,'',1,'',344,'',2,'',3,'',1,0,NULL),(724,'0814d67d9ccb244e1faf06bcedf5a16746eaee8b',1,'',354,'',4,'',354,'',384,'',1,0,NULL),(734,'0213efdf4d1404b662ae78ddc5aa3d2cb26ad94f',1,'',2,'',NULL,'',NULL,'',NULL,'',1,1,NULL),(744,'0434f45502ae57f712ff5afaa33819016addb6cb',1,'',2,'',NULL,'',NULL,'',NULL,'',1,1,NULL),(754,'0434f45502ae57f712ff5afaa33819016addb6cb',1,'',2,'',NULL,'',NULL,'',NULL,'',1,1,NULL),(764,'0434f45502ae57f712ff5afaa33819016addb6cb',1,'',2,'',NULL,'',NULL,'',NULL,'',1,1,NULL),(774,'0434f45502ae57f712ff5afaa33819016addb6cb',1,'',2,