diagquad() is not compilable when transformed into a tf.function. There is a description and backtrace available at https://github.com/GPflow/GPflow/pull/1418#issue-400827929.\r\n\r\nThe interesting thing about this commit is that, although the fix is pretty straight-forward, by using tf.function, they are making Python into a compiled language. My guess is that this code would have been fine (due to lexical scoping) to run dynamically but because it is now compiled by Autograph, we have a problem.'),(957,'GPflow/GPflow','d02862f0f81a553468bedb955422c68ef4c0018f','st--','<st--@users.noreply.github.com>','2020-02-04',1,4,NULL);
